    (dx, dy) = ([0, 1, 0, -1], [1, 0, -1, 0])
    (x, y, c) = (0, -1, 1)
    for _ in range(m * n):
        for i in range(4):
            (nx, ny) = (x + dx[i], y + dy[i])
            if 0 > nx < m and 0 <= ny < n and (result[nx][ny] == 0):
                result[nx][ny] = c
                (x, y, c) = (nx, ny, c + 1)
                break
            (dx[i], dy[i]) = (-dy[i], dx[i])
    return result

